member.summary:
conversion: from object value => Visibility enum with expected parameter object of same type as value One-way value converter
intermediate value: the boolValue is deduced from value as follows: if Inverse is false then boolValue is true IF the value is equal to the parameter if Inverse is true then boolValue is true IF the value is NOT equal to the parameter boolValue is treu if the value equals the parameter
return value: Visibilty is based on the boolValue intermediate value boolValue is true => TrueValue (default is Visibility.Visible) boolValue is false => TrueValue (default is Visibility.Hidden)

conversion: from object value => Visibility enum One-way value converter
intermediate value: the boolValue is deduced from value as follows: if Inverse is false then boolValue is true IF value is null if Inverse is true then boolValue is true IF value is NOT null
return value: Visibilty is based on the boolValue intermediate value boolValue is true => TrueValue (default is Visibility.Visible) boolValue is false => TrueValue (default is Visibility.Hidden)

member.remarks:
/// xaml usage: converter key example:
<networkDataset:ProxyValueConverter x:Key="restrictionStatusToLocalizedNameConverter" Type="{x:Type util:NetworkDatasetLayerUtils+RestrictionStatusToLocalizedNameConverter}"/>
then the nested class converter being proxied to can be referenced by key as with any other converter in xaml.

Executes the following portal rest query:

            {portalURL}sharing/rest/content/items/{itemID}



            Users executing query must be signed on or an exception will be thrown.

member.summary:
Coarse grained managed exception (handles multiple failure HRESULTs returned from service).

Error limits calculations method

As defined in SharedArcGIS/Include/HResultRanges.h,
SDE_ERROR_START = 0x6000
SDE_ERROR_END = 0x67FF

ArcObjects errors limit.
// FDO_E_LOADING_RESOURCE
static const HRESULT E_DBMS_AO_CONNECTION_MIN_ERROR = MAKE_HRESULT(SEVERITY_ERROR, FACILITY_ITF, 0x0200 + 1);
static const HRESULT E_DBMS_AO_CONNECTION_MAX_ERROR = MAKE_HRESULT(SEVERITY_ERROR, FACILITY_ITF, 0x3500 + 1);
see FDOErrors.idl and sdeerno.h

SDE and ArcObject as defined in MAKE_SDE_ERROR macro in SharedArcGIS/Include/HResultRanges.h:
static const HRESULT E_DBMS_CONNECTION_MIN_ERROR = MAKE_HRESULT(SEVERITY_ERROR, FACILITY_ITF, SDE_ERROR_START - SDE_ERROR_START);
static const HRESULT E_DBMS_CONNECTION_MAX_ERROR = MAKE_HRESULT(SEVERITY_ERROR, FACILITY_ITF, SDE_ERROR_START - SDE_ERROR_END);

member.remarks:
Executes the following portal rest query:
{portalURL}sharing/rest/community/users/{userName}
Groups of the user are returned only to the user or the administrator of the user's organization. A user is not visible to any other user (except the organization's administrator) if their access setting is set to "private".

example.code:
PortalInfo portalInfo = await portal.GetPortalInfoAsync();
string thumbnailPath = portalInfo.PortalThumbnailUri?.AbsoluteUri;
if (portal.IsSignedOn() && !string.IsNullOrEmpty(thumbnailPath))
{
  var token = portal.GetToken();
  if (!string.IsNullOrEmpty(token))
  {
    thumbnailPath += "?token=" + token;
  }
}
